     <script type="text/javascript">
	$( ".icomoon div" ).each(function( index ) {
	  $(this).find('span').attr('id', $(this).attr('class'));
	  $(this).find('span').html($(this).attr('class').replace('icmn-',''));
	});
	
	$( ".icomoon div" ).on("click", function() {
		copyToClipboard($(this).find('span').attr('id'));
	});

	function copyToClipboard(elementId) {
	  var aux = document.createElement("input");
	  aux.setAttribute("value", 'icmn-'+document.getElementById(elementId).innerHTML);
	  document.body.appendChild(aux);
	  aux.select();
	  document.execCommand("copy");
	  document.body.removeChild(aux);
	}
	</script>
